import {useAuth0} from '@auth0/auth0-react';

export default function LogOutButton() {
    const {logout} = useAuth0();

    return (
        <button
            onClick={() => {
                logout({returnTo: 'http://localhost:3000'});
            }}
        >
            Log Out
        </button>
    );
}
